(Drupal => {
  Drupal.behaviors.azCardNoFollow = {
    attach(context) {
      function noFollow(event) {
        event.preventDefault();
      }
      const cards = context.querySelectorAll('.az-card-no-follow');
      [...cards].forEach(card => {
        card.addEventListener('click', noFollow);
      });
    }
  };
})(this.Drupal);